        }

        return bytes.buffer;
    }

    const viewer = new XMindEmbedViewer({
        el: container,
        file: atab(contents),
        styles: {
            'height': '100%',
            'width': '100%'
        }
    });
    window.viewer = viewer;
</script>
</html>
